import React, { Component } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

class Login extends Component {
  state = {
    loggedIn: false
  };
  render() {
    const submitForm = () => {
      const email1 = document.getElementById("exampleInputEmail1");
      console.log(email1);
      // const email1=document.getElementById(exampleInputEmail1);
      const params = new URLSearchParams();
      params.append("email", "rishabhkohli13@gmail.com");
      params.append("password", "password");

      let string = '"email" : rishabhkohli13@gmail.com, "password" : "password';

      axios
        .post("http://localhost:8080/login", params)
        .then(Response => console.log(Response));
    };

    return (
      <React.Fragment>
        <form name="sendLoginData">
          <div class="form-group">
            <label for="exampleInputEmail1">Email address</label>
            <input
              type="email"
              className="form-control"
              id="exampleInputEmail1"
              aria-describedby="emailHelp"
              placeholder="Enter email"
            />
            <small id="emailHelp" className="form-text text-muted">
              We'll never share your email with anyone else.
            </small>
          </div>
          <div class="form-group">
            <label for="exampleInputPassword1">Password</label>
            <input
              type="password"
              class="form-control"
              id="exampleInputPassword1"
              placeholder="Password"
            />
          </div>
          <Link to="/signup">
            <a>Create my account</a>
          </Link>

          {/* <div class="form-check">
              <input type="checkbox" class="form-check-input" id="exampleCheck1"/>
              <label class="form-check-label" for="exampleCheck1">Check me out</label>

            </div> */}
          <br></br>
          <button type="submit" class="btn btn-primary" onClick={submitForm()}>
            Login
          </button>
        </form>
      </React.Fragment>
    );
  }
}
export default Login;
